Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map
import java.time.Instant
import java.time.temporal.ChronoUnit

object HitRateCalculator {
  def main(args: Array[String]) {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData = spark.read.format("csv").option("header", "true").load("onsite_data.csv")
      .select("query", "timestamp")
      .rdd
      .map(row => (row.getString(0), row.getLong(1)))

    // Load top frequent queries
    val topQueries = spark.read.format("csv").option("header", "true").load("top_queries.csv")
      .select("query")
      .rdd
      .map(row => row.getString(0))
      .collect()
      .toSet

    // Broadcast top queries to all nodes
    val broadcastTopQueries = spark.sparkContext.broadcast(topQueries)

    // Initialize cache
    val cache = Map[String, (Long, Boolean)]()

    // Process onsite data
    val hitRate = onsiteData.mapPartitions(iter => {
      val cacheMap = Map[String, (Long, Boolean)]()
      val topQueriesSet = broadcastTopQueries.value

      iter.map { case (query, timestamp) =>
        if (topQueriesSet.contains(query)) {
          val cacheEntry = cacheMap.get(query)
          val isHit = cacheEntry match {
            case Some((cachedTimestamp, _)) =>
              val elapsedTime = ChronoUnit.HOURS.between(Instant.ofEpochMilli(cachedTimestamp), Instant.ofEpochMilli(timestamp))
              elapsedTime <= 12
            case None => false
          }

          if (isHit) {
            cacheMap.put(query, (timestamp, true))
            (query, true)
          } else {
            cacheMap.put(query, (timestamp, false))
            (query, false)
          }
        } else {
          (query, false)
        }
      }
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    // Calculate hit rate
    val hitRateValue = hitRate._2.toDouble / hitRate._1
    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from CSV files. It then broadcasts the top frequent queries to all nodes in the cluster.

The job initializes an empty cache and processes the onsite attributed data using the `mapPartitions` transformation. For each query in the onsite attributed data, the job checks if it is present in the top frequent queries. If it is, the job checks if the query is already in the cache and if it has been cached for less than 12 hours. If it is, the job marks it as a cache hit and updates the cache. If it is not, the job marks it as a cache miss and updates the cache.

The job then calculates the hit rate by dividing the number of cache hits by the total number of queries processed.

Note that this job assumes that the onsite attributed data and top frequent queries are in CSV format and that the timestamps are in milliseconds since the Unix epoch. You may need to modify the job to fit your specific use case.

