To create a tooltip in Next.js using React Context to close previously opened tooltips, you can follow these steps:

1. Create a Tooltip context using React's `createContext` function.
```javascript
import React from 'react';

const TooltipContext = React.createContext();

export default TooltipContext;
```
2. Create a TooltipProvider component that wraps your entire application or the components that need to use the tooltip functionality. This component will manage the state of the currently open tooltip and provide a way to close it.
```javascript
import React, { useState } from 'react';
import TooltipContext from './TooltipContext';

const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const closeTooltip = () => {
    setOpenTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
3. Create a Tooltip component that uses the TooltipContext to determine whether it should be open or closed. This component should also provide a way to open the tooltip by calling the `setOpenTooltip` function from the context.
```javascript
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ children, id }) => {
  const { openTooltip, closeTooltip } = useContext(TooltipContext);

  const isOpen = openTooltip === id;

  const handleOpen = () => {
    closeTooltip();
    setOpenTooltip(id);
  };

  return (
    <div onClick={handleOpen}>
      {isOpen && <div>{children}</div>}
    </div>
  );
};

export default Tooltip;
```
4. Wrap your application or the components that need to use the tooltip functionality with the `TooltipProvider` component.
```javascript
import TooltipProvider from './TooltipProvider';

const App = () => {
  return (
    <TooltipProvider>
      {/* Your application components go here */}
    </TooltipProvider>
  );
};

export default App;
```
5. Use the `Tooltip` component in your application where you need to display a tooltip.
```javascript
import Tooltip from './Tooltip';

const MyComponent = () => {
  return (
    <div>
      <Tooltip id="my-tooltip">
        <p>This is the tooltip content</p>
      </Tooltip>
      {/* Other components go here */}
    </div>
  );
};

export default MyComponent;
```
With this setup, whenever a tooltip is opened, the previously opened tooltip will be closed automatically. This is because the `TooltipProvider` component manages the state of the currently open tooltip and provides a way to close it through the `closeTooltip` function. The `Tooltip` component uses this function to close the previously opened tooltip before opening a new one.

