    tl.current.to(portfolioCurrent.current, {
      clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
      duration: 0.5,
    });

    tl.current.to(portfolioNext.current, {
      clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
      delay: 0.1,
      duration: 0.5,
    });

    tl.current.set(portfolioCurrent.current, {
      clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
    });

    tl.current.set(portfolioCurrent.current, {
      css: { backgroundImage: 'url(' + cursor.cursorImage + ')' },
    });
  };

  useEffect(() => {
    if (debounceTimeout.current) {
      clearTimeout(debounceTimeout.current);
    }

    debounceTimeout.current = setTimeout(() => {
      runAnimation();
    }, 600);

    return () => {
      clearTimeout(debounceTimeout.current);
    };
  }, [cursor.cursorImage]);

  return (
    // Your component JSX
  );
};

export default MyComponent;
```

In this code, I've created a `debounceTimeout` ref to store the timeout ID returned by `setTimeout`. In the `useEffect` hook, I check if there's an existing timeout. If there is, I clear it using `clearTimeout`. Then, I set a new timeout to call `runAnimation` after 600 milliseconds (0.6 seconds).

This way, the animation will only run once every 0.6 seconds, even if the `cursor.cursorImage` dependency changes more frequently.

